function orderCreateReducer(state = {}, action) {
    if(action.type === "order_created_successful"){
        return {order: action.payload}
    }
    else if(action.type === "order_created_failed"){
        return {error: action.payload}
    }
    else {
        return state
    }
}

export {orderCreateReducer}
